import React, { Component } from 'react';
import { connect } from "react-redux";
import { relatedVideos } from '../actions/actions';
import { bindActionCreators } from 'redux';

class VideoPlayer extends Component {
    render() {
        return (
            <div>
                <div className="ml-4 mt-4">
                    <iframe width="1000" height="563" title="Title" src={"https://www.youtube.com/embed/6BYIKEH0RCQ?autoplay=1"} allow='autoplay;'>
                    </iframe>
                </div>
                <ul className="list-unstyled">
                    {this.props.videos.map((elem, index) => {
                        return <li className="col-md-2">
                            <div className="row ml-1">
                                <div className="col-md-4 p-2">
                                    <img width="180" height="150" src={elem.snippet.thumbnails.high.url} alt="" />
                                </div>
                                <div className="col-md-8 mt-2 text-truncate text-white">
                                    {elem.snippet.title}
                                </div>
                            </div>
                        </li>
                        }
                    )}
                </ul>
            </div>
        )
    }
    componentDidMount() {
        this.props.relatedVideos()
    }
}

const mapStateToProps = (state) => {
    console.log("landingpage state", state)
    return {
        videos: state.video.videos
    }
}

const mapDispatchToProps = (dispatch) => {
    return bindActionCreators({ relatedVideos }, dispatch)
}


export default connect(mapStateToProps, mapDispatchToProps)(VideoPlayer)
